/* No data */
CREATE TABLE APP.COMMENTS (
	COMMENT_ID INTEGER GENERATED ALWAYS AS IDENTITY NOT NULL,
	FILEHASH VARCHAR(150),
	COMMENT_TEXT VARCHAR(500),
	COMMENT_DATE DATE,
	USER_POST VARCHAR(30),
	PRIMARY KEY (COMMENT_ID)
);


/* 2500 rows */
CREATE TABLE APP.DOWNLOADS (
	FILE_OWNER VARCHAR(30),
	FILE_GROUP VARCHAR(30),
	USER_EMAIL VARCHAR(150),
	TEMPNAME VARCHAR(350),
	FILEID VARCHAR(350),
	FILESIZE BIGINT,
	FILENAME VARCHAR(350),
	FILEHASH VARCHAR(150),
	DURATION INTEGER,
	INCOMING VARCHAR(150),
	NETWORK VARCHAR(150),
	EDK2_HASH VARCHAR(350),
	DATE_DOWLOAD DATE,
	RATING INTEGER DEFAULT 0,
	COUNTER_DOWNLOADS INTEGER DEFAULT 0
);
/* No data */
CREATE TABLE USERS (
	OWNER VARCHAR(30),
	DISCLAIMER CHAR(2)
);

